from tests.utils import TestCommonimport pytest#added by sophia@pytest.mark.p0def test_huawei_correct_data():    rt = TestCommon.AnalysisStartWorkspaceDataGenPieChart.run({        "dsItemIds":["@72|AllRoom_UnderCool_svr",                     "@72|UnderCoolLimit_svr",                     "@72|OverHeatLimit_svr",                     "@72|AllRoom_OverHeat_svr"]})    expected = {      "dsItemList": [        {          "data": "7",          "dsItemId": "@72|AllRoom_UnderCool_svr"        },        {            "data": "18",          "dsItemId": "@72|UnderCoolLimit_svr"        },          {          "data": "26",          "dsItemId": "@72|OverHeatLimit_svr"        },        {          "data": "630",          "dsItemId": "@72|AllRoom_OverHeat_svr"        }      ]}    data={"dsItemIds":["3","@72|UnderCoolLimit_svr","@72|OverHeatLimit_svr","@72|AllRoom_OverHeat_svr"]}    TestCommon.AnalysisStartWorkspaceDataGenPieChart.assert_result_equals(expected, rt)@pytest.mark.p0def test_huawei_null_dsItemIds():    rt = TestCommon.AnalysisStartWorkspaceDataGenPieChart.run({"dsItemIds":[]})    TestCommon.AnalysisStartWorkspaceDataGenPieChart.assert_no_realtime_data(rt)@pytest.mark.p0def test_huawei_invalid_dsItemId_string_error():    rt = TestCommon.AnalysisStartWorkspaceDataGenPieChart.run({        "dsItemIds":["3","@72|UnderCoolLimit_svr",                     "@72|OverHeatLimit_svr",                     "@72|AllRoom_OverHeat_svr"]})    TestCommon.AnalysisStartWorkspaceDataGenPieChart.assert_invalid_dsItemId_string_error(rt)